import { Navbar, Nav, NavDropdown } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// import { faWhatsapp } from '@fortawesome/free-brands-svg-icons';
// import { faEnvelope } from '@fortawesome/';

import Container from '../components/Container';

const Contacto = () => {
  return (
    <div>
      <Container>
        <Nav classNAme="d-flex">
          <Nav.Link className="fas fa-envelope fa-2x" href="https://www.facebook.com/yoquieromisfotos">
            {/* <FontAwesomeIcon icon={faEnvelope} color="black" /> */}
          </Nav.Link>
          <Nav.Link className="fab fa-whatsapp fa-2x" href="https://wa.me/5491135365490">
            {/* <FontAwesomeIcon icon={faWhatsapp} color="black" /> */}
          </Nav.Link>
        </Nav>
      </Container>
    </div>
  );
};
export default Contacto;
